import {useQuery,gql} from '@apollo/client';

const getBookListQuery = gql`
  {
    books{
      id
      name
    }
  }
`
function BookList() {
  const {loading,error,data} = useQuery(getBookListQuery);

  return data.books.map(({id,name})=>(
          <div key={id}>
            <p>{name}</p>
          </div>
  ));
}

export default BookList;
